import React from 'react';

export default function UpcomingEvents() {
  return (
    <section id="upcoming" className="section">
      <h2>Upcoming Event</h2>

      {/* Luma embed widget */}
      <div className="event-card">
        <iframe
          src="https://lu.ma/widget?event=y6cjuv11"
          width="100%"
          height="400"
          style={{ border: 'none', borderRadius: '8px' }}
          allowFullScreen
          title="Luma Event Preview"
        />
      </div>

      <p style={{ textAlign: 'center', marginTop: '16px' }}>
        <a href="https://lu.ma/y6cjuv11" target="_blank" rel="noopener noreferrer">
          View full details on here
        </a>
      </p>
    </section>
  );
}
